import java.util.Scanner;

public class TrainTheTrainers {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int gradersCount = Integer.parseInt(scanner.nextLine());

        double totalSum = 0.0;
        int totalCount = 0;

        String command = scanner.nextLine();
        while (!command.equals("Finish")) {
            String presentationName = command;
            double currentGradesSum = 0.0;

            for (int i = 1; i <= gradersCount; i++) {
                double grade = Double.parseDouble(scanner.nextLine());

                currentGradesSum += grade;
                totalSum += grade;
                totalCount++;
            }

            System.out.printf("%s - %.2f.%n", presentationName, currentGradesSum / gradersCount);
            command = scanner.nextLine();
        }

        System.out.printf("Student's final assessment is %.2f.", totalSum / totalCount);
    }
}

package _06_NestedLoops;

import java.util.Scanner;

public class SumPrimeNonPrime {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int primeNumbersSum = 0;
        int nonPrimeNumbersSum = 0;

        String command = scanner.nextLine();
        while (!command.equals("stop")) {
            boolean isNumberNegative = false;

            int number = Integer.parseInt(command);
            if (number < 0) {
                System.out.println("Number is negative.");
                isNumberNegative = true;
            }
            int dividersCount = 0;

            if (!isNumberNegative) {
                for (int i = 1; i <= number; i++) {
                    if (number % i == 0) {
                        dividersCount++;
                    }
                }

                if (dividersCount > 2) {
                    nonPrimeNumbersSum += number;
                } else {
                    primeNumbersSum += number;
                }
            }

            command = scanner.nextLine();
        }


        System.out.printf("Sum of all prime numbers is: %d%n" +
                "Sum of all non prime numbers is: %d", primeNumbersSum, nonPrimeNumbersSum);

    }
}

package _06_NestedLoops;

import java.util.Scanner;

public class EqualSumsEvenOddPosition {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int num1 = Integer.parseInt(scanner.nextLine());
        int num2 = Integer.parseInt(scanner.nextLine());

        for (int i = num1; i <= num2; i++) {
            int number = i;
            int evenPositions = 0;
            int oddPositions = 0;

            for (int j = 0; j <= 5; j++) {
                int lastDigit = number % 10;
                number = number / 10;

                if (j % 2 == 0) {
                    evenPositions += lastDigit;
                } else {
                    oddPositions += lastDigit;
                }
            }

            if (evenPositions == oddPositions) {
                System.out.print(i + " ");
            }


        }

    }
}

package _06_NestedLoops;

import java.util.Scanner;

public class NumberPyramid {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = Integer.parseInt(scanner.nextLine());
        int numCounter = 1;

        boolean isNumReached = false;
        for (int row = 1; row <= n; row++) {

            for (int column = 1; column <= row; column++) {
                if (numCounter > n) {
                    isNumReached = true;
                    break;
                }
                System.out.print(numCounter++ + " ");
            }

            if (isNumReached) {
                break;
            }
            System.out.println();
        }
    }
}
